import React, { Component } from "react";

// ************Images*************
import Size from "../Assets/size.png";
import Luggage from "../Assets/luggage.png";
import Route from "../Assets/route.png";
import Calendar from "../Assets/calendar.png";
import CheckBox from "../Assets/check-box.png";
import Arrow from "../Assets/arrow.png";
import Warning from "../Assets/warning.png";

// **********Style Sheet**********
import "./MyMove.css";

class MyMove extends Component {
  constructor(props) {
    super(props);
    this.state = {
      totalItemCount: 0,
    };
  }

  UNSAFE_componentWillReceiveProps(newProps) {
    const data = newProps.data;
    this.setState({
      totalItemCount: data.total_items,
    });
  }

  render() {
    console.log(this.totalItemCount);
    return (
      <>
        <h1 className="head-up">My Moves</h1>
        <div className="cards">
          <div className="move-head">
            <div className="up from">
              <h1>From</h1> <br /> <p>{appData.moving_from}</p>
            </div>
            <div className="up round">
              <img src={Arrow} alt="" />
            </div>
            <div className="up to">
              <h1>To</h1> <br /> <p>{appData.moving_to}</p>
            </div>
            <div className="up request">
              <h1>Request#</h1> <br /> <p>{appData.estimate_id}</p>
            </div>
          </div>
          <div className="move-center">
            <div className="middle home">
              <img src={Size} alt="" />
              <p>{appData.property_size}</p>
            </div>
            <div className="middle luggage">
              <img src={Luggage} alt="" />
              <p>{this.state.totalItemCount}</p>
            </div>
            <div className="middle navigation">
              <img src={Route} alt="" />
              <p>{appData.distance}</p>
            </div>
            <div className="middle calander">
              <img src={Calendar} alt="" />
              <p>{appData.moving_on}</p>
            </div>
            <div className="middle checkbox">
              <img src={CheckBox} alt="" />
              <p>is flexible</p>
            </div>
            <button className="middle-btn one">View move details</button>
            <button className="middle-btn two">Quotes Awaiting</button>
          </div>
          <div className="bottom">
            <img src={Warning} alt="" /> <h1>Disclaimer: </h1>{" "}
            <p> Please update your move date before two days of shifting</p>
          </div>
        </div>
      </>
    );
  }
}

export default MyMove;
